   <br></br>
  </video> </h2>;
  }

  function Garage() {

    return (
      <>


          {vids.map((car) => <Car brand={car} />)}

      </>
    );
  }

function App() {
  return (
    <div>
      <a href="./upload.html">upload video</a>
      <h1>Yubtub</h1>
      <h2>Random Videos</h2>
      <br/>
     <Garage/>
    </div>
  );
}

export default App;
